INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (2, 'ARCHIVED', 40, 154, 137, null, TIMESTAMP '2003-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (3, 'ARCHIVED', 40, 89, 52, null, TIMESTAMP '2004-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (4, 'ARCHIVED', 47, 93, null, 'CWT 2005 was mostly dominated by war veterans. Although the first 2 places of the tournament were won by newcomers they were the only ones being in the quarter-finals. There were many delays to the tournament and it was marked by long laggs from certain players. Also, there was the case of the "girl", a character known as WormingGirl, a supposed girl from Uzbekistan, which was the creation of a russian wormer whose nick I honestly don''t recall, and who handed over the lie after the qualifiers to one wormer who hadn''t had a chance to be in due to the lack of spots available, Johnmir. He proceeded in his disguise to the semi-finals but he revealed after realizing what he was doing. The penalty was not to be able to continue in his progress. The dutchman HHC made a comeback after one year of absence and it was Teletubbies''s last CWT.', TIMESTAMP '2005-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (5, 'ARCHIVED', 27, 17, 40, 'In this edition of CWT the number of wormers was increased to 40 since a qualifiers competition was out of question due to the amount of time needed to have it going, plus the decreasing numbers of normal wormers in the WWP comunity, which also narrowed the competition possibilites to this extent. Timekeeping was enforced by MrTPenguin who distributed some of his dreaded point penalties and cut some wormers off from the tournament, but not that many. The most times the tournament slowed down was due to personal handicaps of certain wormers. Some problems relating disconnections were reported but there wasn''t much of a case going from these issues. Some valuable newcomers added great flavor to the tournament and if we take a peek at the knockout standings we''ll see a 75% ratio of newcomers on the quarter-finals, although the 2 veterans of CWT in that 25% ratio of non-newcomers actually made it to the podium! The top newcomers of CWT 2006 were SirGorash, Rafalus, cOOL, Franpetas, XWorm, Dvorkin and Johnmir. Also relating players, the presence of the bi-champion Jigsaw should be noted since it was a comeback from the grave by the polish titan. And last but not least, the winner was Dario, who beated the russian newcomer Johnmir in the final, and who was therefore crowned champion of CWT, justifying his evolution at the normal style in the last years, which led him to a highly consistent level of play. This was the last edition of CWT in the WWP format.', TIMESTAMP '2006-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (6, 'ARCHIVED', 27, 40, null, null, TIMESTAMP '2007-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (7, 'ARCHIVED', 30, 37, 38, null, TIMESTAMP '2008-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (8, 'ARCHIVED', 17, 38, 13, 'In 2009 the admin team introduced something they called â€œfixed scheduleâ€. Prior to the tournamentâ€™s start the attendees had to inform the staff about their preferred times to play games for CWT. Games were then scheduled by the admin team and an Excel spreadsheet was released. It ultimately resulted in a disgracefully high amount of bans. The acts of the admin teamâ€”which became smaller as the tournament went onâ€”remained very questionable and occasionally raise arguments to date.
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (9, 'ARCHIVED', 11, 10, 27, '2010 was in every aspect a breakthroug. Thanks to Zemke, CWT players had for the very first time in 8-years CWT, the possibility to upload, comment and rate their games. The new site http://www.cwsite.com allowed us moderators to strengthen players activity: 3% of voided group stage games (2009: 28%) with simultaneous consideration that the whole tournament only endured 2 months, are good exemples for a raising professionalism. A good mix of veterans (SirGorash, Bytor, NormalPro), rookies (Ivo, chuvash, Fonseca) and All-Stars (Dario, Mablak) formed an unpredecent qualitative high-class starter field.
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (10, 'ARCHIVED', 27, 13, 11, 'With the experiences we made in 2010, in which the home and away results during group stage period have very rarely differed , Zemke and me decided to accommodate the system to the realities. From 2011 on, the players had to play only one best of five game against their group opponents. Thanks to this modification and the generosity of 18 donors, who stimulated the players with a cash prize of 300 $(US) and 3 trophies, we celebrated for the first time in CWT history a tournament with 100% completed games.
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (11, 'ARCHIVED', 46, 55, 10, 'In 2012 we had a nice battle of current pros who gave everything in the playoffs and group stage to reach the goal of winning, having many close 3-2 victories. Very interesting and close games happened, sometimes also against the prediction of the votes, like Tomek winning Mablak and lacoste winning Koras :). chuvash won the cup and the prize money of 170 dollar after having to fight vs. almost all of Pot A: FaD, Kayz, nappy and Koras. He improved during the last seasons a lot and proved himself a worthy victor with high concentrated and deep strategy playing style. Though Worms in general went a bit inactive, still all games were played. Thanks for this tourney, it was a great fun.', TIMESTAMP '2012-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (12, 'ARCHIVED', 46, 13, 11, null, TIMESTAMP '2013-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (13, 'ARCHIVED', 55, 46, 10, null, TIMESTAMP '2014-01-01 00:00:00');
INSERT INTO tournament (id, status, gold_winner_id, silver_winner_id, bronze_winner_id, review, created) VALUES (14, 'ARCHIVED', 46, 10, 55, null, TIMESTAMP '2015-01-01 00:00:00');
