INSERT INTO user_profile (id, clan, country, about, facebook, modified, skype, twitter, user_id) VALUES (15, 'eS', 'Brazil', 'Is a honor represent my coutry among the intermediate players, and make this game more popular everyday to people closed to me. To play the famous "normal" we don''t need to much skills, because his learning curve has a high angle, the skills are needed in especific situations, considering the cost-benefit relation, and vs who are you playing; it makes the real diference of playing "normal" normaly and be an elite cold and calculating player. The high level of this tourney games shows why we can call the "Intermediate" the most complete and skillful scheme as a whole.', '', '2012-10-04 12:14:11', '', '', 15);
