INSERT INTO user_profile (id, clan, country, about, facebook, modified, skype, twitter, user_id) VALUES (39, '', 'Poland', 'For me Worms as game is first of all FUN which is defined by me as: an opportunity to use various weapons in various situations (always at best skills and with creative reasonable ideas), trying to make good moves at schemes I like, playing in nice atmosphere with layed-back, polite and intelligent people who enjoy the game and not take it too serious. That is why I like user created tactic schemes with crates to collect (which make the game even more fun and add some unique thrill where every game is a fantastic never-the-same experience, where you''ll never get the same weapon set again). The crates provide much exciting stuff to be used / saved for other rounds, as I prefer longgames at user created schemes with stockpiling mostly (or antistockpiling). I''d define my skill as creative funplay at average skill, nothing serious. Concerning playing style I''m a lightsider who knows how to darkside when it''s necessary. I think the majority of Worms community is too much 1-scheme-oriented which is somewhat routinous. Not many players know how to have fun (usually seen by negative comments after bad moves... - it simply shouldn''t matter), or simply do not reveal it in the game. The most important advice which comes to my mind is making less known schemes popularised, but I know already that the community is not oriented for such ideas and won''t accept this in a long term.
INSERT INTO user_profile (id, clan, country, about, facebook, modified, skype, twitter, user_id) VALUES (40, 'NNN', 'Poland', 'I loved the idea of this game from the time I saw worms 2 maaaany years ago, then when I got computer and internet connection it was the first game I wanted to play online! As for my skills - they are very unsteady, I''m a casual player nowadays but I can''t say I''m not trying to play at my best. The community of inter players is much wider than it used to be, and the competition level is significantly greater than few years ago, good going community! ;-)', '', null, '', '', 40);
INSERT INTO user_profile (id, clan, country, about, facebook, modified, skype, twitter, user_id) VALUES (41, 'dP', 'Poland', '.. well funny game.. communication is unfortunatelly getting worse and worse. my skill poor, but i learn fast ..........', '', null, '', '', 41);
