INSERT INTO user_profile (id, clan, country, about, facebook, modified, skype, twitter, user_id) VALUES (43, 'NNN', 'Romania', 'I like worms because of its analogy to real life, and i mean intermediate scheme in particular. We have all same hp but we are placed in different context. I like to play darkside and like players who abuse of strategy and planning. But i don''t mind playing as lightside as posible when needed, usually i change style acording to who i am playing with.', '', null, '', '', 43);
INSERT INTO user_profile (id, clan, country, about, facebook, modified, skype, twitter, user_id) VALUES (44, '', 'Spain', 'Worms is a very addicted game, i love it !! there r a lot of schemes in worms but i think ppl who created game dont imagine that game will be so playable, rope games dont need to use ur brain in excess , normal game was the objective of this game ^^ ppl in Wnet undervalue normal players ( fu normal, ill host a rope game lol ), i hope this "thinking" will change with tourneys and leagues like CWT & NNN ( ty admins ) well, i like to play fairly and im not a darksider, i like to attack more than expecting other player hit my "littles" worms ty 4 all & greetings from Spain', '', null, '', '', 44);
