INSERT INTO public.message (id, body, category, created, author_id) VALUES (3302, 'the rules say "Respect the first-turn-order" which isn''t watertight. If Free had won R3 then he would''ve started in R4, giving each player one first turn in a cave and island, and of course, in any R5, it''s essentially lucky who gets the first turn', 'SHOUTBOX', '2016-11-02 15:48:27.000000', 52);
