INSERT INTO public.message (id, body, category, created, author_id) VALUES (3299, 'I don''t know if anyone remembers, but sometimes it''s useful to read the rules. "When you are going to replay a round, the map should be similar to the one used in the incomplete round, and the player that had the starting turn in the incomplete round must have the starting turn again. If the player that has to get the starting turn doesn''t, one of the 2 players will surrender and the round will be restarted, which fixes the starting order."', 'SHOUTBOX', '2016-11-02 15:25:57.000000', 10);
