INSERT INTO public.message (id, body, category, created, author_id) VALUES (2081, 'Well, deadlines is a diffrent issue. I personally think mods did a good job to find some compromise between strict action and no action at all. They found a balance and we have successfull cwt tournaments one after the other. It''s not that easy to find ideal solution. I think playing 2 games one after the other did you a great help actually. You warmed up on kalababa and then unleashed your brain powers on me in a full blow. ', 'SHOUTBOX', '2015-11-02 13:53:55.000000', 5);
