INSERT INTO public.message (id, body, category, created, author_id) VALUES (2079, 'I have huge respect about people who make this tornament happen, including you. But if the rules are so stabile than there would be bans about not playing till the end od given period, not just postponing it. It''s not an excuse... but what do you think... couldn''t I play 2 games in different days instead od calculating "brain freshness" in the 1st game, and beeing a bit tired the 2nd one. Btw Khams belive me it''s not personal at all friend. Just the sistem which we all aproved. ', 'SHOUTBOX', '2015-11-02 10:47:30.000000', 37);
INSERT INTO public.message (id, body, category, created, author_id) VALUES (2078, 'Here. Read and learn: http://www.normalnonoobs.com/forum/viewtopic.php?f=24&t=1514&sid=568f2c6015c49262f0ce5c1e52398dc5', 'SHOUTBOX', '2015-11-02 09:34:26.000000', 5);
INSERT INTO public.message (id, body, category, created, author_id) VALUES (2077, 'Paradox happens because unlike RL tournaments we give extra point for 3-2 win. 3. Paradox because of an extra point system gives for 3-2. It''s also in the forums. 3. Not EVERY tournament has tie-breakers in between players in question. Champions League calculate points in between players in question. World Cup calculates overall points. ', 'SHOUTBOX', '2015-11-02 09:30:06.000000', 5);
INSERT INTO public.message (id, body, category, created, author_id) VALUES (2076, '1. You should be more respectful to the tournament and the people who make this thing happen and check stuff before calling rules "stupid". There was a poll on this issue. Check forums. 2. Also there was an in-depth discussion of this issue that revealed a paradox that makes tie-breaker between players in question wrong. ', 'SHOUTBOX', '2015-11-02 09:28:26.000000', 5);
INSERT INTO public.message (id, body, category, created, author_id) VALUES (2075, 'The 1 point kalababa got means nothing in your scenario, but it might in other cases, if we didn''t involve the 4th player. Imagine you''d have a player in the group who wins everyone 3-0, but you manage to get a round out of him, but since he got 9 points, he doesn''t count in the 3-way tie of the other 3 players, then you''d say it''s unfair as well. I hope you understand that your logic is flawed.', 'SHOUTBOX', '2015-11-02 04:06:07.000000', 10);
INSERT INTO public.message (id, body, category, created, author_id) VALUES (2074, '" And just here. In any sport, in any competition, if there are 3 teams with same score, their circle is important. Example... if U win 3:0, Chuvash should be out, if U win 3:2 U should be out, and with 3:1 I should be out." this is just wrong. for a group to work, the overall stats are considered. Your game vs kalababa counts as much as any other single game. It would be damn unfair if we ignored games, only because someone either won all games, or lost all games. We give 1 point for losing 2-3', 'SHOUTBOX', '2015-11-02 04:02:46.000000', 10);
INSERT INTO public.message (id, body, category, created, author_id) VALUES (2073, 'math and logic don''t need a poll. You are not thinking analytical here, I tried to explain why the overall stats matter and round ratio is damn important for this system to work, but you didn''t listen :/', 'SHOUTBOX', '2015-11-02 03:59:06.000000', 10);
